import React from 'react';

const BooksOffers = () => {
  const mediaServices = [
    {
      title: "Newspaper Advertising",
      buttonText: "Book Now",
      bgColor: "#e3f2fd"
    },
    {
      title: "Digital Marketing",
      buttonText: "Book Now",
      bgColor: "#e3f2fd"
    },
    {
      title: "Radio Advertising",
      buttonText: "Book Now",
      bgColor: "#e3f2fd"
    },
    {
      title: "Influencer",
      buttonText: "Fill Query or Call 880033...",
      bgColor: "#e3f2fd"
    }
  ];

  return (
    <div style={styles.wrapper}>
      {/* Hire Media Planner Section */}
      <section style={styles.hireSection}>
        <div style={styles.container}>
          <h1 style={styles.mainTitle}>Books and Offers</h1>
          <div style={styles.hireCard}>
            <h2 style={styles.hireTitle}>Hire Dedicated Media Planner for your business Today!</h2>
            <div style={styles.hireDetails}>
              <p style={styles.hirePrice}>Just 499/-</p>
              <button style={styles.hireButton}>Hire Now</button>
            </div>
          </div>
          <div style={styles.divider}></div>
        </div>
      </section>

      {/* Media Services Section */}
      <section style={styles.mediaSection}>
        <div style={styles.container}>
          <h2 style={styles.mediaTitle}>What Media are you looking for?</h2>
          <p style={styles.mediaSubtitle}>
            The right place for your business: BookMyAd provides 360-degree solutions. Book the best advertising options for you online here:
          </p>
          
          <div style={styles.mediaGrid}>
            {mediaServices.map((service, index) => (
              <div key={index} style={styles.mediaCard}>
                <div style={{...styles.mediaImageContainer, backgroundColor: service.bgColor}}>
                  {/* Empty container for image */}
                </div>
                <div style={styles.mediaCardContent}>
                  <h3 style={styles.mediaCardTitle}>Start Your</h3>
                  <h4 style={styles.mediaCardService}>{service.title}</h4>
                  <button style={styles.mediaCardButton}>{service.buttonText}</button>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

const styles = {
  wrapper: {
    backgroundColor: '#f8f9fa',
    padding: '20px 0',
    fontFamily: 'Arial, sans-serif'
  },
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '0 20px'
  },
  mainTitle: {
    fontSize: '2rem',
    color: '#333',
    marginBottom: '30px',
    textAlign: 'center',
    fontWeight: 'bold'
  },
  hireSection: {
    marginBottom: '40px'
  },
  hireCard: {
    backgroundColor: '#fff',
    borderRadius: '8px',
    padding: '25px',
    boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
    textAlign: 'center',
    marginBottom: '20px'
  },
  hireTitle: {
    fontSize: '1.5rem',
    color: '#333',
    marginBottom: '15px',
    fontWeight: '600'
  },
  hireDetails: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    gap: '20px'
  },
  hirePrice: {
    fontSize: '1.3rem',
    color: '#333',
    fontWeight: 'bold'
  },
  hireButton: {
    padding: '10px 25px',
    backgroundColor: '#ff4444',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    fontSize: '1rem',
    cursor: 'pointer',
    fontWeight: '600'
  },
  divider: {
    height: '1px',
    backgroundColor: '#ddd',
    margin: '20px 0'
  },
  mediaSection: {
    padding: '20px 0'
  },
  mediaTitle: {
    fontSize: '1.8rem',
    color: '#333',
    marginBottom: '15px',
    textAlign: 'center',
    fontWeight: 'bold'
  },
  mediaSubtitle: {
    fontSize: '1rem',
    color: '#666',
    textAlign: 'center',
    marginBottom: '30px',
    lineHeight: '1.5',
    maxWidth: '800px',
    marginLeft: 'auto',
    marginRight: 'auto'
  },
  mediaGrid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
    gap: '20px',
    maxWidth: '1200px',
    margin: '0 auto'
  },
  mediaCard: {
    backgroundColor: '#fff',
    borderRadius: '8px',
    overflow: 'hidden',
    boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
    transition: 'transform 0.3s',
    ':hover': {
      transform: 'translateY(-5px)'
    }
  },
  mediaImageContainer: {
    height: '150px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  },
  mediaCardContent: {
    padding: '20px',
    textAlign: 'center'
  },
  mediaCardTitle: {
    fontSize: '1rem',
    color: '#666',
    marginBottom: '5px',
    fontWeight: '400'
  },
  mediaCardService: {
    fontSize: '1.2rem',
    color: '#333',
    marginBottom: '15px',
    fontWeight: 'bold'
  },
  mediaCardButton: {
    padding: '8px 20px',
    backgroundColor: '#333',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    fontSize: '0.9rem',
    cursor: 'pointer',
    fontWeight: '600',
    width: '100%'
  }
};

export default BooksOffers;
